import { useParams } from "react-router-dom";

const Details = () => {

    const {id} = useParams()

    return ( 
        <div className="container-lg">
            <div className="row justify-content-center">
                <div className="col-9">
                    <p>Details {id}</p>
                </div>
            </div>
            
        </div>
     );
}
 
export default Details;
